import React from "react";

function Register() {
    return(
        <>
    <header className="header">
      <div className="header__logo"></div>
      <h2 className="header__title">Войти</h2>
    </header>
    <div className='main-page'>
        <h2 className='main-page__title'>Регистрация</h2>
        <form className="main-page__form">
            <input className="main-page__input" value="" id="reg-email-input" type="email" name='email' placeholder="Email"></input>
            <input className="main-page__input" value="" id="reg-password-input" type="password" name='password' placeholder="Пароль"></input>
            <button className="main-page__button" type="submit">Зарегистрироваться</button>
        </form>
    </div>
    </>
    )
}

export default Register;
